# Script för att skapa NewtonTestTool databas

DROP SCHEMA IF EXISTS FlightBooking;
CREATE SCHEMA FlightBooking CHARACTER SET utf8 COLLATE utf8_general_ci;
GRANT ALL ON FlightBooking.* TO root@localhost IDENTIFIED BY 'root';

USE FlightBooking;

# drop table if exists AirPlane;
