# drop table if exists Seat;

create table AirPlane (aId bigint not null, name varchar(255) not null, seats integer not null, cId bigint not null, primary key (aId)) ENGINE=InnoDB;
create table Booking (bId bigint not null, fId bigint not null, frId bigint, payment varchar(255) not null, primary key (bId)) ENGINE=InnoDB;
create table Company (cId bigint not null, name varchar(255) not null, primary key (cId)) ENGINE=InnoDB;
create table Destination (dId bigint not null auto_increment, name varchar(255) not null, primary key (dId)) ENGINE=InnoDB;
create table Flight (fId bigint not null, arrival datetime, departure datetime not null, name varchar(255) not null, fromDest varchar(255) not null, toDest varchar(255) not null, aId bigint not null, primary key (fId)) ENGINE=InnoDB;
create table Passenger (pId bigint not null, age integer not null, email varchar(255), fname varchar(255) not null, lname varchar(255) not null, phone varchar(255), bId bigint not null, primary key (pId)) ENGINE=InnoDB;
create table Seat (sId bigint not null, available boolean default true not null, price integer not null, sClass varchar(255) not null, fId bigint not null, tId bigint, primary key (sId)) ENGINE=InnoDB;
create table Ticket (tId bigint not null, sId bigint not null, pId bigint not null, primary key (tId)) ENGINE=InnoDB;
create table SequenceGenerator ( seqName varchar(255),  seqValue integer ) ENGINE=InnoDB;

alter table Destination add constraint UK_4355fgxcietdl3g85oq0o0h07  unique (name);
alter table AirPlane add constraint FK_pgmtlfubtihpy5gdonpliehjq foreign key (cId) references Company (cId);
alter table Flight add constraint FK_shk37quxvuxestcon1tr0mabi foreign key (aId) references AirPlane (aId);
alter table Passenger add constraint FK_rhkg43pis75j4uv9pes0ru5iu foreign key (bId) references Booking (bId);
alter table Seat add constraint FK_p7ny8veutkin2avrk5lpasmn8 foreign key (fId) references Flight (fId);
alter table Seat add constraint FK_p6e8sp4jk2mwroppv4uytejmr foreign key (tId) references Ticket (tId);
alter table Ticket add constraint FK_ghmnad4hgemswfck33u5g5hja foreign key (pId) references Passenger (pId);

